import React from 'react';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import airplaneImage from '../assets/img/airplaneimg.jpeg';
import airplaneGif from '../assets/img/airplanegif.gif';

const ParallaxAirplane = () => {
    return (
        <Parallax pages={2} style={{ top: '0', left: '0' }}>
            {/* Background layer */}
            <ParallaxLayer offset={0} speed={0.5} style={{ backgroundColor: '#87CEEB' }} />

            {/* Airplane layer */}
            <ParallaxLayer offset={0.5} speed={1.5}>
                <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                    <img src={airplaneImage} alt="Airplane" style={{ width: '60%' }} />
                </div>
                <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                    <img src={airplaneGif} alt="Airplane" style={{ width: '60%' }} />
                </div>
            </ParallaxLayer>

            {/* Other content layers */}
            {/* ... */}
        </Parallax>
    );
};

export default ParallaxAirplane;
